import React from "react";
import "../css/viewExamsheet.css";
import { Card } from "antd";
const ViewExamsheet = () => {
  return (
    <div>
      <h1 className="Title">Upload Examsheet</h1>
      <Card
        className="card-edit"
        style={{
          width: 1400,
          height: 600,
        }}
      >
        <p>Card content</p>
      </Card>
    </div>
  );
};

export default ViewExamsheet;
